  @override
  String get termOfUseText => 'Отказ от ответственности\nВ максимальной степени, разрешенной применимым законодательством, мы исключаем все заявления, гарантии и\nусловия, касающиеся нашего веб-сайта и использования этого веб-сайта. Ничто в этом отказе от ответственности:\nне ограничивает или исключает нашу или вашу ответственность за смерть или личную травмы;\nограничить или исключить нашу или вашу ответственность за мошенничество или умышленное введение в заблуждение;\nограничить любую из наших или ваших обязательств любым способом, не разрешенным действующим законодательством; или\nисключить любую из наших или ваших обязательств, которые не могут быть исключены в соответствии с применимое право.\nОграничения и запреты ответственности, установленные в этом разделе и в других местах данного отказа от ответственности: (a) регулируются\nпредыдущим параграфом и (b) регулируют все обязательства, возникающие в соответствии с отказом от ответственности, включая обязательства, возникающие по договору, в результате правонарушения и за нарушение установленных законом обязанностей.\n\nПоскольку веб-сайт, а также информация и услуги на веб-сайте предоставляются бесплатно, мы\nне несем ответственности за любые убытки или ущерб любого характера. .\n\nУсловия использования платных услуг по вывозу\nКак часть сообщества ApagaCommunity, вы можете подписаться как физическое лицо или\nорганизация на регулярный вывоз перерабатываемых отходов из вашего дома, предприятия, здания или офиса.\n\nПодписываясь на эту услугу, вы подтверждаете, что будете соблюдать следующие пункты:\nЕсли подписка годовая, оплатить полную сумму подписки при первом получении или в течение 14 дней\nс момента первого получения,\nЕсли подписка на самовывоз, оплатить полную сумму вывоза в день вывоза,\nесли подписка на домохозяйство, отправить до 200 л пластиковых отходов, 100 л бумажных отходов и/или 50 л\nстеклянных отходов за каждый вывоз в зависимости от типа подписки. \nПри организационной подписке отправлять до 600 л пластиковых отходов, 300 л бумажных отходов и/или 100 л\nотходов стекла за один вывоз в соответствии с типом подписки.\nОтправлять ТОЛЬКО чистые, отсортированные, пригодные для вторичной переработки отходы в соответствии с выделенным количеством .\nПластик НЕ должен содержать любые следы остатков пищи\nПластик МОЖЕТ иметь этикетки и крышки\nСледующие виды пластика НЕ ​​подлежат вторичной переработке в Армении: ПВХ, вспененный полистирол.\nНа бумаге не должно быть масляных пятен или остатков пищи.\nБумага не должна состоять из или ламинированные другими типами материалов, такими как пластик и/или металлы\nСтекло не должно быть разбито\nСтекло не должно быть частью какого-либо электронного оборудования или деталей автомобиля\nВсе отходы должны быть упакованы в мешки до того, как водитель приедет к вам.\nМешки не предоставлено ЗАО «АпагаСообщество».\nВ связи со случайными трудностями с просроченными клиентами убедитесь, что вы доступны по телефону в\nдень получения, если не указано иное.\nЕсли вы не можете связаться по телефону и нет конкретных инструкций по где забрать\nваши отходы, водитель не подойдет, а ваш пикап считается утерянным.\nМожно заказать внеплановый вывоз, отказавшись от одного из договорных вывозов или доплатив\nдополнительно. Свяжитесь с нами, чтобы получить ценовое предложение.\nУсловия использования сети SmartApaga Recycling Containers\nЯвляясь частью сообщества ApagaCommunity, вы можете получить доступ к нашей сети SmartApaga\nRecycling Containers как физическое лицо или организация.\n\nПодписавшись на эту услугу , вы подтверждаете, что будете соблюдать следующие пункты:\nВы будете утилизировать только чистый и пригодный для вторичной переработки пластик:\nПластик НЕ ДОЛЖЕН содержать следов остатков пищи\nПластик МОЖЕТ иметь этикетки и крышки\nСледующие типы пластика НЕ ​​подлежат вторичной переработке в Армении: ПВХ, пенополистирол.\nВы не будете переполнять контейнеры\nВы не будете пытаться обмануть, загружая в контейнеры другие более тяжелые материалы с целью\nполучения дополнительных наград ApagaCoin.\nВы не будете пытаться повредить контейнеры контейнеры\nВы сообщите нам, если станете свидетелем попыток повреждения контейнеров';

  @override
  String get privacyPolicyText => 'SmartApaga > Политика конфиденциальности ООО \'СмартАпага\' создало приложение SmartApaga как Бесплатное приложение.\nЭта СЛУЖБА предоставляется ООО \'СмартАпага\' бесплатно и предназначена для использования как есть.\n\nЭта страница используется для информирования посетителей о нашей политике с сбор, использование и раскрытие\nЛичной информации, если кто-либо решил использовать нашу Службу.\n\nЕсли вы решите использовать нашу Службу, вы соглашаетесь на сбор и использование информации в отношении\nэтой политики. которую мы собираем, используется для предоставления и улучшения Сервиса.\nМы не будем использовать или передавать вашу информацию кому-либо, кроме случаев, описанных в настоящей Политике конфиденциальности.\n\nПонятия, используемые в настоящей Политике конфиденциальности, имеют те же значения, что и в наших Условиях использования. ,\nкоторый доступен на SmartApaga, если иное не указано в настоящей Политике конфиденциальности.\n\nСбор и использование информации\n\nДля лучшего использования нашего Сервиса мы можем потребовать от вас предоставить нам определенную\nличную информацию, т.е. nвключая, но не ограничиваясь, полное имя, номер телефона, адрес электронной почты,\nадрес. Информация, которую мы запрашиваем, будет сохранена нами и использована, как описано в этой политике конфиденциальности.\nПриложение использует сторонние службы, которые могут собирать информацию, используемую для вашей идентификации.\n\nСсылка на политику конфиденциальности сторонних поставщиков услуг, используемую приложение\n\nДанные журнала сервисов Google Play\n\nМы хотим сообщить вам, что всякий раз, когда вы используете наш Сервис, в случае ошибки в приложении мы собираем\nданные и информацию (через сторонние продукты) на вашем телефоне под названием Данные журнала. Эти данные журнала могут\nвключать в себя такую ​​информацию, как адрес интернет-протокола («IP») вашего устройства, имя устройства, версия\nоперационной системы, конфигурация приложения при использовании нашего Сервиса, время и дата использования вами Сервиса и другая статистика.\n\nФайлы cookie\n\nФайлы cookie — это файлы с небольшим объемом данных, которые обычно используются в качестве анонимных уникальных\nидентификаторов. Они отправляются в ваш браузер с веб-сайтов, которые вы посещаете, и хранятся во внутренней памяти вашего\nустройства.\n\nЭта Служба не использует эти «куки» явно. Однако приложение может использовать сторонний код и\nбиблиотеки, которые используют файлы cookie для сбора информации и улучшения своих услуг. У вас есть возможность\n не принимать или отклонять эти файлы cookie и знать, когда файл cookie отправляется на ваше устройство. Если вы\nрешите отказаться от наших файлов cookie, вы не сможете использовать некоторые части этой Услуги.\n\nПоставщики услуг\n\nМы можем нанимать сторонние компании и частных лиц по следующим причинам:\n\nДля облегчения наш сервис; Для предоставления Сервиса от нашего имени; Для оказания услуг, связанных с Сервисом; или\nЧтобы помочь нам проанализировать, как используется наш Сервис. Мы хотим сообщить пользователям этой Услуги, что эти\nтретьи лица имеют доступ к вашей Личной информации. Причина в том, чтобы выполнять порученные\nим задачи от нашего имени. Тем не менее, они обязаны не раскрывать и не использовать информацию для каких-либо других целей.\n\nБезопасность\n\nМы ценим ваше доверие в предоставлении нам вашей личной информации, поэтому мы стремимся использовать коммерчески\nприемлемые средства ее защиты. Но помните, что ни один метод передачи через Интернет или метод электронного хранения не являются на 100 % безопасными и надежными, и мы не можем гарантировать их абсолютную безопасность.\n\nСсылки на другие сайты\n\nЭта служба может содержать ссылки на другие сайты. . Если вы нажмете на стороннюю ссылку, вы будете перенаправлены на этот\nсайт. Обратите внимание, что эти внешние сайты не управляются нами. Поэтому мы настоятельно рекомендуем вам ознакомиться\nПолитика конфиденциальности этих веб-сайтов.\nМы не контролируем и не несем ответственности за содержание, политику конфиденциальности или действия любых сторонних сайтов или служб.\n\nКонфиденциальность детей\n\nЭти Сервисы не предназначены для лиц моложе 13 лет. Мы сознательно не собираем личную\nидентифицирующую информацию от детей младше 13 лет. Если мы обнаружим, что ребенок в возрасте\n13 лет предоставил нам личную информацию, мы немедленно удалим ее с наших серверов. Если вы\nявляетесь родителем или опекуном и знаете, что ваш ребенок предоставил нам личную информацию,\nпожалуйста, свяжитесь с нами, чтобы мы могли предпринять необходимые действия.\n\nИзменения в настоящей Политике конфиденциальности\n\nМы можем время от времени обновлять нашу Политику конфиденциальности. Поэтому рекомендуется периодически\nпросматривать эту страницу на предмет любых изменений. Мы сообщим вам о любых изменениях, опубликовав новую Политику конфиденциальности\nна этой странице.\n\nСвяжитесь с нами\n\nЕсли у вас есть какие-либо вопросы или предложения относительно нашей Политики конфиденциальности, не стесняйтесь обращаться к нам по адресу\ninfo@smartapaga.com';

